import React from 'react';

class VendedorInfo extends React.Component {
  render() {
    const sellerName = 'Nome do Vendedor';
    const sellerEmail = 'email@exemplo.com';
    const sellerPhone = '123456789';
    const sellerRating = 4.5;

    return (
      <div className="seller-info">
        <h3>Informações do Vendedor</h3>
        <p>Nome: {sellerName}</p>
        <p>E-mail: {sellerEmail}</p>
        <p>Telefone: {sellerPhone}</p>
        <p>Nota: {sellerRating}/5</p>
      </div>
    );
  }
}

export default VendedorInfo;
